  \"2016-07-27T22:21:13.963021\",\n\t\"name\": \"land-protection-plan-ellicott-slough-national-wildlife-refuge-proposed-buena-vista-additio\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Land Protection Plan, as part of the Environmental
  Assessment, Land Protection Plan and Conceptual Management Plan for the proposed
  Buena Vista addition to the Ellicott Slough National Wildlife Refuge in Santa Cruz
  County, California. Content includes project description, threats to and status
  of the resource, proposed action and goals, habitat protection methods, land protection
  priorities, sociocultural impacts, and coordination. Nothing in this plan constitutes
  an offer to purchase private property, or an usurpation of the authority of the
  State of California, Santa Cruz County, or any other jurisdiction to regulate land
  use within the proposed refuge boundary. This plan is intended to guide the Serviceu2019s
  proposed land protection activities subject to the availability of funds and other
  constraints. The Service proposes to expand the Refugeu2019s approved land acquisition
  boundary and provide protection and management within the proposed expanded boundary.
  The Serviceu2019s proposed action includes approximately 289 acres of oak woodland,
  chaparral, riparian forest, freshwater marshes, and a SCLTS breeding pond. By acquiring
  the Buena Vista property, survival prospects of endangered species in the area would
  be enhanced. This expansion is being proposed primarily to protect the endangered
  SCLTS (Ambystoma macrodactylum croceum). In addition, acquisition and management
  of this site would benefit other rare species including the endangered robust spineflower
  (Chorizanthe robusta var. robusta) and the threatened California tiger salamander
  (Ambystoma californiense). Buena Vista supports one of only six known populations
  of robust spineflower, and 135 acres of the property are included in the designated
  critical habitat. Other rare plants include hookeru2019s manzanita (Arctostaphylos
  hookeri ssp. hookeri), Kelloggu2019s horkelia (Horkelia cuneata ssp. sericea), and
  California bottlebrush grass (Elymus californicus).\",\n\t\"license_title\": \"License
